import React from 'react';
import '../css/app.css';
import Header from '../../header';

function Home() {
  return (
    <>
        <Header />
        <div className='top-wrapper'>
            <h1 className='Kijima'>Kijima Riku</h1>
            <p className='portforio'>-PORTFORIO-</p>
        </div>
        <div className='about-wrapper'>
            <h2 className='about'>ABOUT</h2>
        </div>
    </>
  );
}

export default Home;
